import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Header from './components/common/Header';
import Footer from './components/common/Footer';

// Importe tes pages
import Home from './pages/Home.js'; // Le nouveau composant de la page d'accueil
import Panier from './pages/panier.js';
import Commande from './pages/commande.js';
// ... importe tes autres pages ici (Login, Register, Catalogue, etc.)

function App() {
  return (
    <Router>
      <div className="flex flex-col min-h-screen bg-gray-50">
        <Header />
        <main className="flex-grow container mx-auto px-4 py-8">
          <Routes>
            <Route path="/" element={<Home />} />
            <Route path="/panier" element={<Panier />} />
            <Route path="/commande" element={<Commande />} />
            {/* Ajoute les autres routes ici */}
          </Routes>
        </main>
        <Footer />
      </div>
    </Router>
  );
}

export default App;
